import './App.css';
import FavoritesMap from './components/FavoritesMap';
import { MapContainer } from 'react-leaflet';
import { LatLngExpression } from 'leaflet';
import { StockList } from './resources/constants';
import { useState } from 'react';
import { ChekitMap } from './resources/MapResources';


const position: LatLngExpression = [39.7392, -104.9903];

function App() {
  const [map, setMap] = useState<ChekitMap>(StockList);

  return (
    <div className="App">
      <h1>T's List Denver</h1>
      <MapContainer
            center={position} 
            zoom={map.zoom}
            scrollWheelZoom={true}
            touchZoom={true}
        >
          <FavoritesMap />
        </MapContainer>

    </div>
  );
}

export default App;
